Column.Formula:
LET $current := ARRAY([EFormType], [RecordID]);
LET $descriptionColumns := 
HASH(
	"Contract",  					"Contract Number", 
	"Vendor", 						"Company Name",
	"Procurement", 					"Procurement Number",
	"Project", 						"Project Number",
    "Evaluation", 		    		"Description",
  	"Information Request",  		"File No.", 
	"Subpoena", 					"File No.",
	"Privacy Incident", 			"File No."
); 

LET $altFormName:= HASH(
  	"Insurance",	"Compliance"
  );

LET $getLabelText := $(eFormType, recordID)
(
  	LET $targetColumn := HASH_GET($descriptionColumns, $eFormType);
  	RETURN 
  	IF( $targetColumn = NULL, NULL,
		LET $isthisRecord := ARRAY($eFormType, $recordID) = $current;
		LET $title:= 
		IF( $isthisRecord = TRUE, 
			CURRENT_VALUE($targetColumn),
			ARRAY_FIRST(DB_LOOKUP(
				ARRAY($targetColumn),
				$eFormType, 
				"[RecordID] FAST_EQUAL_TO " & $recordID
			))
		  );
		//shortern the descriptive label/ title
		LET $charCount := LEN($title);
		LET $titleArray := SPLIT($title, " ");
		LET $wordCount := ARRAY_LENGTH($titleArray);

		LET $charLimit := 30; 
		LET $wordLimit := ARRAY_LENGTH( SPLIT( LEFT($title, $charLimit), " ") );

	  RETURN //ARRAY_TAKE($titleArray, $wordLimit)
		IF(
			$wordCount <= $wordLimit, $title,
			ARRAY_JOIN(
				ARRAY_TAKE($titleArray, $wordLimit), " "
			)& " ..."
		)
	  )

); 

LET $getReadAccess := $(eFormType, recordID)
( EBMS_GET_EFORMRECORD_PERMISSION($eFormType, $recordID, "read"));

LET $currentDes := CALL($getLabelText, [EFormType], [RecordID]);
LET $currentAccess := FALSE;

RETURN
IF(
	[Parent Structure] <> NULL, [Parent Structure],
  	(

	  LET $parent := 
	  IF( 
		[RecordID] > 0, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($current), ARRAY_INDEX($current, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
				  )

			  )
	  )); 

	  LET $gParent := 
	  IF( 
		 $parent <> NULL, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($parent), ARRAY_INDEX($parent, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
			  )
		  )
	  )); 

	  LET $hash :=  
	  HASH_MERGE(
		  IF( $parent <> NULL, HASH("parent", 	$parent)),
		  IF( $gParent <> NULL, HASH("gparent", 	$gParent))
	  );

	  LET $parentStructure := 	//2nd instance
	  IF( 
		  ARRAY_LENGTH(HASH_KEYS($hash)) >0, $hash, NULL
	  );

	  LET $parentData:= 
	  ARRAY_WHERE(
		ARRAY(
			$gParent, 
			$parent, 
			ARRAY_CONCAT($current, $currentDes, $currentAccess),
		), $(i,item) $item <> NULL
	   );


	  LET $parentChain:=
		ARRAY_SELECT(
			  $parentData, $(i, item)
			  ARRAY_TAKE($item, 2)
	   );


	  LET $parentLinks :=
	  ARRAY_SELECT(
		  $parentData, $(i, item) 
			  LET $eFormType 		:= ARRAY_FIRST($item);
			  LET $recordID 		:= ARRAY_INDEX($item, 2);
			  LET $descriptiveLabel := ARRAY_INDEX($item, 3);
			  LET $hasReadAccess	:= ARRAY_INDEX($item, 4);
			  LET $URL	:= "records/" & URLENCODE($eFormType) & "/" & $recordID ;
			  LET $showEFormType := $eFormType <> "Vendor";

			  LET $labelColour := 
				  IF(
				   AND($eFormType = [EFormType], $recordID = [RecordID]),
					  "background: #ffffff; color: #5D5D5D;",
					 $hasReadAccess = TRUE,
					  "background: #ffffff; color: #4D87B7;",
					  "background: #ffffff; color: #5D5D5D;"

				  );



			  LET $labeltext:= 
					  IF( $showEFormType == TRUE, " " & COALESCE(HASH_GET($altFormName, $eFormType), $eFormType) ) &
					  IF(NOT(ISBLANK($descriptiveLabel)), " " & $descriptiveLabel);

			  LET $label :=  
				  "<span style=""margin-left: 5px;" & $labelColour & """>" &
				  HTMLENCODE($labeltext) & 
				  "</span>";

			  RETURN 
			  IF( 
				  $hasReadAccess == TRUE, 
				  "<a style=""text-decoration-line: none;"" href=" & HTMLENCODE($URL) & ">" & $label & "</a>",
				  $label 
			  )
	  );

	   LET $separator :=   "<svg style=""vertical-align: bottom; margin-left: 5px; height: 18px;"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 256 512""><path fill=""#5D5D5D"" d=""M246.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-128-128c-9.2-9.2-22.9-11.9-34.9-6.9s-19.8 16.6-19.8 29.6l0 256c0 12.9 7.8 24.6 19.8 29.6s25.7 2.2 34.9-6.9l128-128z""/></svg>";

	  LET $breadcrumb := "<div style=""height: 23px; padding-left: 5px; font-size: 10pt; color: #5D5D5D; "">You are here:" & ARRAY_JOIN($parentLinks, $separator) & "</div>";

	  RETURN 
	  HASH(
		  "Parent Structure",	$parentStructure,
		  "Parent Data", 		$parentData,
		  "Parent Chain",		$parentChain,
		  "Breadcrumb",		$breadcrumb
		)
	 )
)

LET $result := ARRAY_FIRST(
	ARRAY_FIRST(
		DB_REPORT(
			"SUM([Amount])",
			"Information Request",
			"[LineNumber] = 1 AND [Request Type] = 'Freedom of Information' AND [Section 18 transfer] = 'Yes' AND [Transfer In/Out] = 'Transfer Out' AND TO_DAY([Date Received]) >= " & DB_ENCODECONSTANT(TODAY([Report From])) & " AND TO_DAY([Date Received]) <= " & DB_ENCODECONSTANT(TODAY([Report To])) 
		)
	)
);

RETURN COALESCE($result, 0)

FieldEntry.Formula:
IF(
	ISBLANK([Financial Year]), NULL(),
	(
		LET $fy := LEFT([Financial Year], 4);

		RETURN DATE($fy, 7, 1)
	)
)

IF(
	ISBLANK([Financial Year]), NULL(),
	(
		LET $fy := RIGHT([Financial Year], 4);

		RETURN DATE($fy, 6, 30)
	)
)

Binding.Expression:
LET $requestTypes := [Request Types];
LET $any := HASH("text", "Any", "value", NULL);

RETURN
ARRAY_CONCAT($any,
  ARRAY_SELECT(
	  $requestTypes, $(i, item)
	  HASH("text", $item, "value", $item)
   )
)

//get requests that have date of decision
LET $data := 
	DB_LOOKUPALL(
		ARRAY(
			"Decision Maker Username",
			"Decision Maker Name",
			"Decision Type"
		),
		"Information Request",
		"[LineNumber] FAST_EQUAL_TO 1 AND [Request Type] FAST_EQUAL_TO " & DB_ENCODECONSTANT([Request Type]) & " OR " & DB_ENCODECONSTANT(ISBLANK([Request Type])) & " AND TO_DAY([Date of Decision]) >= " & DB_ENCODECONSTANT(TODAY([Report From])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report From])) & " AND TO_DAY([Date of Decision]) <= " & DB_ENCODECONSTANT(TODAY([Report To])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report To]))
);

//list of decision types -- dynamic
LET $decisionTypesList := [Decision Types];

//grouping by decision type
LET $hashed := 
		ARRAY_TO_HASH_GROUPED(
			$data, 
			$(i, item) $item, 
			$(i, item) $item
		);

LET $keys := HASH_KEYS($hashed);

LET $rowsData := 
	ARRAY_DISTINCT(
		ARRAY_SELECT(
			$keys, $(k, key)
			LET $decisionMaker := ARRAY_FIRST($key);
			LET $decisionMakerName := COALESCE(EBMS_GET_ROLE_DISPLAYNAME($decisionMaker), ARRAY_INDEX($key, 2));
			LET $decisionData := 
				ARRAY_SELECT(
					$decisionTypesList, $(i, decisionType)
					ARRAY_LENGTH(
						HASH_GET($hashed, ARRAY($decisionMaker, $decisionMakerName, $decisionType))
					)
				);
			LET $total := SUM($decisionData);

			RETURN 
			ARRAY_CONCAT(
				$decisionMakerName,
				$decisionData,
				$total
			)
		)
	);

LET $totalDecisionTypes := ARRAY_SKIP(ARRAY_TRANSPOSE($rowsData), 1);

LET $horizontalTotal := ARRAY_SELECT($totalDecisionTypes, $(i, item) SUM($item));

LET $headings := ARRAY_CONCAT(HASH("heading", "Decision Maker","width", 150), ARRAY_SELECT($decisionTypesList, $(i, item) HASH("heading", $item, "width", 100)), HASH("heading", "Total", "width", 100)); 

RETURN HASH(
    "columns", $headings, 
    "rows",    $rowsData,
	"totals", ARRAY_CONCAT(ARRAY("Total:"), $horizontalTotal)
 )

LET $data := 
	DB_LOOKUPALL(
    	"Exemptions",
   	 	"Information Request Escalation",
    	"[Source EFormType] FAST_EQUAL_TO 'Information Request' AND [Request Type] FAST_EQUAL_TO " & DB_ENCODECONSTANT([Request Type]) & " OR " & DB_ENCODECONSTANT(ISBLANK([Request Type])) & " AND [Escalation Type] FAST_EQUAL_TO 'Administration Tribunal' AND " &
    	"TO_DAY([Date of Decision]) >= " &  DB_ENCODECONSTANT(TODAY([Report From])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report From])) & " AND TO_DAY([Date of Decision]) <= "& DB_ENCODECONSTANT(TODAY([Report To])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report To]))
	);

LET $combine := ARRAY_SELECTMANY($data, $(i, item) $item);

LET $distinct := ARRAY_DISTINCT($combine);

LET $rows := 
	ARRAY_SELECT(
  		$distinct, $(i, item) 
		LET $matches := 
			ARRAY_WHERE(
			  $combine, $(j, jitem)
			  $item == $jitem
			);

		RETURN     
			ARRAY(
				$item, 
				ARRAY_LENGTH($matches)
			)
	);

LET $totals := ARRAY_LENGTH($combine);

 LET $headings := ARRAY(
    HASH("heading", "Exemption", "width", 360),
    HASH("heading", "Count",     "width", 120)
);    

RETURN HASH(
    "columns", $headings, 
    "rows",    $rows,
    "totals",  ARRAY(ARRAY("Total", $totals))
    )

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Application Fee Status"),
			HASH_GET([Information Request Data], "Amount")
		)
	);

//Get sum of paid application fee
LET $paidApplicationFee :=
	SUM(
		ARRAY_SELECT(
			ARRAY_WHERE($getData, $(i, item) ARRAY_FIRST($item) == "Paid"),
		  		$(i, item) ARRAY_LAST($item)
	  		)
	);

RETURN NUMBERFORMAT(COALESCE($paidApplicationFee, 0), "C")

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Application Fee Status"),
			HASH_GET([Information Request Data], "Amount")
		)
	);
//Get sum of waived application fees
LET $waivedApplicationFee :=
	SUM(
		ARRAY_SELECT(
			ARRAY_WHERE($getData, $(i, item) 
				ARRAY_FIRST($item) == "Waived"
		  ),
		  $(i, item)
		  ARRAY_LAST($item)
	  	)
	);

RETURN NUMBERFORMAT(COALESCE($waivedApplicationFee, 0), "C")

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Application Fee Status"), //1
		  	HASH_GET([Information Request Data], "Section Transfer"), //2
		  	HASH_GET([Information Request Data], "Transfer In/Out"), //3
			HASH_GET([Information Request Data], "Amount") //4
		)
	);

//Get sum of paid application fee of requests that were transferred out into another agency
LET $applicationFeeTransferredOut :=
	SUM(
		ARRAY_SELECT(
			ARRAY_WHERE($getData, $(i, item) 
			  	AND(
					ARRAY_INDEX($item, 1) == "Paid",
					ARRAY_INDEX($item, 2) == "Yes",
			  		ARRAY_INDEX($item, 3) == "Transfer Out"
					)
			  	),
		  	$(i, item) ARRAY_LAST($item)
	  	)
	);

RETURN NUMBERFORMAT(COALESCE($applicationFeeTransferredOut, 0), "C")

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Fee Collected?"), //1
		  	HASH_GET([Information Request Data], "Access Charge"), //2
		  	HASH_GET([Information Request Data], "Access Charge Reduced") //3
		)
	);

//Subtract reduced access charge from the access charge to amount collected
LET $accessChargeCollected :=
	SUM(
		ARRAY_SELECT(
			ARRAY_WHERE($getData, $(i, item) 
				ARRAY_INDEX($item, 1) == "Paid"
			),
		  	$(i, item) 
			ARRAY_INDEX($item, 2) - ARRAY_LAST($item) 
	  	)
	);

RETURN NUMBERFORMAT(COALESCE($accessChargeCollected, 0), "C")

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Fee Collected?"), //1
		  	HASH_GET([Information Request Data], "Access Charge Reduced") //2
		)
	);

//Get sum of reduced access charged that were waived. This covers partially waived access charges
LET $accessChargeWaived :=
	SUM(
		ARRAY_SELECT(
			ARRAY_WHERE($getData, $(i, item) 
				ARRAY_INDEX($item, 1) == "Waived"
			),
		  	$(i, item) 
			ARRAY_LAST($item) 
	  	)
	);

RETURN NUMBERFORMAT(COALESCE($accessChargeWaived, 0), "C")

LET $getData :=
	ARRAY_TRANSPOSE(
		ARRAY(
			HASH_GET([Information Request Data], "Application Fee Status"),
			HASH_GET([Information Request Data], "Decision Type")
		)
	);

//Get requests that were not paid and no decision was made
LET $unpaidUndecidedRequests :=
	ARRAY_LENGTH(
		ARRAY_WHERE($getData, $(i, item) 
			  AND(
				ARRAY_FIRST($item) == "Not Paid"),
				ISBLANK(ARRAY_LAST($item))
			)
	);

RETURN COALESCE($unpaidUndecidedRequests, 0)

FieldEntry.Formula:
LET $thisFY := FINANCIALYEAR(TODAY());  //2021

LET $fy :=  $thisFY-2&"/"&$thisFY-1;

RETURN IF(
	ISBLANK($fy), NULL(),
	(
		LET $start := LEFT($fy, 4);

		RETURN DATE($start, 7, 1)
	)
)

LET $thisFY := FINANCIALYEAR(TODAY());  //2021

LET $fy :=  $thisFY-2&"/"&$thisFY-1;

RETURN IF(
	ISBLANK($fy), NULL(),
	(
		LET $end := RIGHT($fy, 4);

		RETURN DATE($end, 6, 30)
	)
)

