	"[LineNumber] FAST_EQUAL_TO 1 AND [Request Type] FAST_EQUAL_TO " & DB_ENCODECONSTANT([Request Type]) & " OR " & DB_ENCODECONSTANT(ISBLANK([Request Type])) & " AND TO_DAY([Date Received]) >= " & DB_ENCODECONSTANT(TODAY([Report From])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report From])) & " AND TO_DAY([Date Received]) <= " & DB_ENCODECONSTANT(TODAY([Report To])) & " OR " & DB_ENCODECONSTANT(ISBLANK([Report To]));

